import React, { Fragment, useEffect, useState } from "react"
import Moment from 'moment';

const Details = props => {
    const [details] = useState(props.DetailsFile);
    if (details) {
        console.log(details);
    }

    return (
        <Fragment>

            <div className="text-center">
                <h3>Details</h3>
                <hr />
                {}
                <h4 className="text-secondary">{props.DetailsFile.title}</h4>
                <p className="small fw-light">{Moment(props.DetailsFile.uploadDate).format('dddd - DD MMMM yyyy')}</p>

                <hr />
                <h5>Main file</h5>
                {props.DetailsFile.file}
            </div>

        </Fragment>
    )
}
export default Details;
